const imageStyle = {
  display: "inlineBlock",
  width: 1000,
  height: "auto",
  marginLeft: "auto",
  marginRight: "auto",
  textAlign: "center",
};

function TopImage() {
  return (
    <div>
      <img style={imageStyle} src="/wine.jpg" alt="ワインの写真" />
    </div>
  );
}

export default TopImage;
